import React, { useState, useEffect } from 'react';
import imageToAdd from "../../../assets/calendar-clock.png";
import { View, Text, ScrollView, Button, Modal, TextInput, StyleSheet} from 'react-native';

import { useNavigation, useRoute } from '@react-navigation/native';

export function Reservas() {
    const route = useRoute();
    const navigation = useNavigation();
    const [reservas, setReservas] = useState([]);
    const [modalVisible, setModalVisible] = useState(false);
    const [currentReserva, setCurrentReserva] = useState(null);
    const [ambientes, setAmbientes] = useState([]);
    const [dia, setDia] = useState('');
    const [horario, setHorario] = useState('');
    const [motivo, setMotivo] = useState('');
    const { userEmail, userNome } = route.params;

    useEffect(() => {
        fetch('http://localhost:8090/ambiente')
            .then(response => response.json())
            .then(data => setAmbientes(data));
    }, []);

    useEffect(() => {
        fetch(`http://localhost:19006/reserva?userEmail=${userEmail}`)
            .then(response => response.json())
            .then(data => setReservas(data))
            .catch(error => console.error(error));
    }, []);

    const handleEdit = (reserva) => {
        setCurrentReserva(reserva);
        setModalVisible(true);
    };

    const handleCancel = (reserva) => {
        // Implemente a l√≥gica para cancelar a reserva aqui
    };

    const handleReserveSubmit = () => {
        const reserva = {
            userEmail: userEmail, 
            userNome: userNome, 
            ambiente: { id: currentAmbiente.id },
            motivo: motivo,
            data: dia,
            hora: horario
        };
        console.log(reserva)
        
        fetch('http://localhost:8090/reserva', {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json'
            },
            body: JSON.stringify(reserva)
        }).then(response => {
            if (response.ok) {
                alert('Reserva feita com sucesso!');
                setModalVisible(false);
            } else {
                alert('Erro ao fazer reserva.');
            }
        });
    };

    return (
        <View style={styles.container}>
            <ScrollView contentContainerStyle={styles.contentContainer}>
                {reservas.length === 0 ? (
                    <View style={styles.centralize}>
                        <img src={imageToAdd} style={{height:150, width:150}} alt="Image" />
                        <Text style={styles.message}>Voc√™ n√£o possui nenhuma reserva</Text>
                    </View>
                ) : (
                    reservas.map((reserva, index) => (
                        <View key={index} style={styles.reservaContainer}>
                            <Text style={styles.nomeAmbiente}>{reserva.Ambiente}</Text>
                            <Text style={styles.dataHorario}>{`Data: ${reserva.data}, Hor√°rio: ${reserva.horario}`}</Text>
                            <Button title="Editar" onPress={() => handleEdit(reserva)} />
                            <Button title="Cancelar" onPress={() => handleCancel(reserva)} />
                        </View>
                    ))
                )}
            </ScrollView>

            <Modal
                animationType="slide"
                transparent={true}
                visible={modalVisible}
                onRequestClose={() => {
                    setModalVisible(!modalVisible);
                }}
            >
                <View style={styles.centeredView}>
                    <View style={styles.modalView}>
                        <Text style={styles.modalText}>Editar Reserva {currentReserva?.nomeAmbiente}</Text>
                        <TextInput
                            style={styles.input}
                            placeholder="Dia (yyyy-MM-dd)"
                            onChangeText={text => setDia(text)}
                            value={dia}
                        />
                        <TextInput
                            style={styles.input}
                            placeholder="Hor√°rio (HH:mm)"
                            onChangeText={text => setHorario(text)}
                            value={horario}
                        />
                        <TextInput
                            style={styles.input}
                            placeholder="Motivo"
                            onChangeText={text => setMotivo(text)}
                            value={motivo}
                        />
                        <Button
                            title="Salvar"
                            onPress={handleReserveSubmit}
                        />
                        <Button
                            title="Fechar"
                            onPress={() => setModalVisible(!modalVisible)}
                        />
                    </View>
                </View>
            </Modal>
        </View>
    );
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: "white",
    },
    centralize: {
        flex: 1,
        justifyContent: 'center',
        alignItems: 'center',
    },
    contentContainer: {
        flexGrow: 1,
    },
    message: {
        fontSize: 20,
    },
    reservaContainer: {
        backgroundColor: '#f8f4f4', // Cor de fundo para a reserva
        margin: 10,
        borderRadius: 10, // Borda arredondada
        padding: 10,
    },
    nomeAmbiente: {
        fontSize: 18,
        fontWeight: 'bold',
    },
    dataHorario: {
        fontSize: 16,
    },
});
